import { Component } from '@angular/core';
import data from './patientData.json';

class IPatient {
  FirstName!: string;
  LastName!: string;
  ChartNo!: string;
  Address1!: string;
}
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  title = 'search';
  patientData: { [key: string]: string } = {
    '/': '',
    '@': '',
    '#': '',
    $: '',
  };
  patientsData: IPatient[] = data;
  filterData!: IPatient[];
  searchFieldValue = `${this.patientData['/']}${this.patientData['@']}${this.patientData['#']}${this.patientData['$']}`;
  constructor() {}

  setSearchFieldValue(): void {
    this.searchFieldValue = '';
    console.log(this.patientData);
    for (const key of Object.keys(this.patientData)) {
      const value = this.patientData[key];
      // Check if the value is not empty
      if (value !== '') {
        // Append the key and value to the searchFieldValue
        this.searchFieldValue += `${key}${value}`;
      } else {
      }
    }
  }

  setFieldDataBasedSearch(): void {
    const regex = /([/@#$])([^/@#$\s]*)/g;
    let match;
    while ((match = regex.exec(this.searchFieldValue))) {
      this.patientData[match[1]] = match[2];
    }
  }

  getSerchData(): void {
    if (this.searchFieldValue) {
      this.filterData = this.patientsData.filter((user: IPatient) => {
        return (
          user.FirstName.toLowerCase().includes(this.patientData['/'].toLowerCase()) &&
          user.LastName.toLowerCase().includes(this.patientData['@'].toLowerCase()) &&
          user.ChartNo.toLowerCase().includes(this.patientData['#'].toLowerCase()) &&
          user.Address1.toLowerCase().includes(this.patientData['$'].toLowerCase())
        ).valueOf();
      });
    }
  }

  clear():void{
    this.patientData={
      '/': '',
      '@': '',
      '#': '',
      $: '',
    };
    this.filterData=[]
    this.searchFieldValue=''
  }
}
<section class="p-4 rounded-3 border m-3" style="background-color: 	#B2E3FA;">
  <p>Search Patient</p>
  <div class="row">
    <div class="col-6">
      <div class="border rounded-3" style="background-color: #D0EBF7;">
        <p class="ps-3 rounded-3 border bg-warning">Search by</p>
        <table class="table p-3" >
          <tr>
            <td>\ First name</td>
            <td>
              <input
                type="text"
                class="form-control w-75"
                [(ngModel)]="patientData['/']"
                (keyup)="setSearchFieldValue()"
              />
            </td>
          </tr>
          <tr>
            <td>@ Last name</td>
            <td>
              <input
                type="text"
                class="form-control w-75"
                [(ngModel)]="patientData['@']"
                (keyup)="setSearchFieldValue()"
              />
            </td>
          </tr>
          <tr>
            <td># Chart no</td>
            <td>
              <input
                type="text"
                class="form-control w-75"
                [(ngModel)]="patientData['#']"
                (keyup)="setSearchFieldValue()"
              />
            </td>
          </tr>
          <tr>
            <td>$ Address 1</td>
            <td>
              <input
                type="text"
                class="form-control w-75"
                [(ngModel)]="patientData['$']"
                (keyup)="setSearchFieldValue()"
              />
            </td>
          </tr>
        </table>
      </div>
    </div>
    <div class="col-6">
      <div class="border rounded-3">
        <p class="ps-3 rounded-3 border bg-warning">Search</p>
        <div class="d-flex p-3">
          <input
            type="search"
            class="form-control"
            [(ngModel)]="searchFieldValue"
            (keyup)="setFieldDataBasedSearch()"
          />
          <button
            class="btn border ms-1"
            type="button"
            (click)="getSerchData()"
          >
            Search
          </button>
          <button class="btn border ms-1" type="button" (click)="clear()">
            Clear
          </button>
        </div>
      </div>
      <div class="border rounded-3 mt-3">
        <p class="ps-3 rounded-3 border bg-primary text-white fw-bold">
          Results
        </p>
        <div class="table-responsive">
          <table class="table mx-3 table-bordered w-100">
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Chart No</th>
              <th>Address 1</th>
            </tr>
            <tr *ngFor="let user of filterData">
              <td>{{ user.FirstName }}</td>
              <td>{{ user.LastName }}</td>
              <td>{{ user.ChartNo }}</td>
              <td>{{ user.Address1 }}</td>
            </tr>
          </table>
        </div>
      </div>
    </div>
  </div>
</section>
